import React, { Component } from "react";
import {
  CardElement,
  injectStripe,
  Elements,
  StripeProvider,
} from "@stripe/react-stripe-js";
import { loadStripe } from "@stripe/stripe-js";

class Checkout extends Component {
  submit(e) {
    // e.preventDefault();
  }
  render() {
    return (
      <div className="checkout">
        <CardElement></CardElement>
        <button onClick={this.submit()}> paye</button>
      </div>
    );
  }
}

const WrappedForm = () => {
    return
  <StripeProvider>
    <Elements>
      <Checkout />
    </Elements>
  </StripeProvider>;
};
export default WrappedForm;
